import {useState} from 'react';
import React from 'react';
import MyTour from './tour/Tour'
import MyTourDetails from '../TourDetails/TourDetails'
const Tours = ({data}) =>{

    const [isClicked, setIsClicked] = useState(false);
    const [tourDetails, setTourDetails] = useState(data);
    return(
        <>
        <MyTourDetails tourDetails={data} />
        <MyTour setTourDetails={setTourDetails} isClicked={isClicked} setIsClicked={setIsClicked}/>
        </>                
    )
};

export default Tours;
